// AllDoctors.js
import React, { useEffect, useState } from 'react';
import { adminApi, setAuthToken } from '../../api'; // Update the path
import CreateDoctorScheduleForm from './CreateDoctorScheduleForm';

const AllDoctors = () => {
  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    // Set JWT token in headers before making any admin API requests
    setAuthToken();

    // Fetch the list of all doctors
    adminApi.getAllDoctors()
      .then(response => {
        setDoctors(response.data.doctorUsers
            );
        console.log('API Response:', response.data.doctorUsers
        );
      })
      .catch(error => {
        console.error('Error fetching doctors:', error);
      });
  }, []); // Make sure to run this effect only once on component mount
  const handleCreateSchedules = async (doctorId, scheduleData) => {
    try {
      // Use the createDoctorSchedules API function to create schedules for the specified doctor
      const response = await adminApi.createDoctorSchedules(doctorId, scheduleData);

      // Handle the response as needed
      console.log('Doctor schedules created successfully:', response.data);

      // You can perform additional actions after successful schedule creation if needed
    } catch (error) {
      console.error('Error creating doctor schedules:', error);
      // Handle the error (display an error message, etc.)
    }
  };
  return (
    <div>
      <h2>Doctors</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Specialization</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {doctors.map(doctor => (
            <tr key={doctor.doctorId}>
              <td>{doctor.name}</td>
              <td>{doctor.specialization}</td>
              <td>
                <CreateDoctorScheduleForm
                  onCreateSchedule={(scheduleData) => handleCreateSchedules(doctor.doctorId, scheduleData)}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AllDoctors;
